import { uploadPhoto, createUser } from './utils';

export default function handleProfileSignup() {
  const promise1 = uploadPhoto();
  const promise2 = createUser();
  return Promise.allSettled([promise1, promise2])
    .then((results) => {
      let message = '';
      let isError = false;
      let errormessage = '';
